int* binSearchFirst(int* head, int* tail,int val)
{
	int* first = NULL;
	while (!(head>tail))
	{
		int* mid = head + (tail - head) / 2;
		if (*mid == val) // if found, save value and search left
		{
			first = mid;
			tail = mid - 1;
		}else if (val < *mid) // smaller, left
		{
			tail = mid - 1;
		}
		else // larger, right
		{
			head = mid + 1;
		}
	}
	return first;
}

int* binSearchLast(int* head, int* tail, int val)
{
	int* last = NULL;
	while (!(head > tail))
	{
		int* mid = head + (tail - head) / 2;
		if (*mid == val) // if found, save value and search right
		{
			last = mid;
			head = mid + 1;
		}else if (val < *mid) // smaller, left
		{
			tail = mid - 1;
		}
		else // larger, right
		{
			head = mid + 1;
		}
	}
	return last;
}

void binSearchPrint(int* head, int* tail, int val)
{
	int* first = binSearchFirst(head, tail, val);
	if (first == NULL)
	{
		cout << -1;
		return;
	}
	int* last = binSearchLast(head,tail, val);
	while (!(first>last))
	{
		cout << first++ - head << ' ';
	}
}

void printArray(int* head, int* tail)
{
	while (!(head > tail))
	{
		cout << *(head++) << ' ';
	}cout << endl;
}
